  [],\n\t\"revision_timestamp\": \"2015-05-06T22:31:53.546281\",\n\t\"name\": \"micro-thruster-development-with-green-propellant-at-mn-and-micron-levels-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The objectives of the project is
  the development of single emitter and multiple emitter injectors for doped kerosene;
  to develop a fundamental understanding of droplet transport, evaporation, and mixing
  in the complex swirling flow fields required for meso-scale flame stabilization;
  and the system integration of meso-scale thrust chamber with electrospray fuel injection
  system. A single emitter electrospray configuration will be developed and the performance
  benchmarked using Phase Doppler Particle Analysis to determine the droplet size
  distribution as a function of flow rate. The nature of droplet transport and evaporation
  at the meso-scale will be studied using non-intrusive laser based techniques. The
  electrospray injector will be integrated into the existing heat regenerating thrust
  chamber and fired with kerosene/H2O2.&lt;/p&gt;\",\n\t\"license_title\": \"U.S.
